SELECT i_item_id, ca_country, ca_state, ca_county, AVG(CAST(cs_quantity AS decimal(12,2))) AS agg1, AVG(CAST(cs_list_price AS decimal(12,2))) AS agg2, AVG(CAST(cs_coupon_amt AS decimal(12,2))) AS agg3, AVG(CAST(cs_sales_price AS decimal(12,2))) AS agg4, AVG(CAST(cs_net_profit AS decimal(12,2))) AS agg5, AVG(CAST(c_birth_year AS decimal(12,2))) AS agg6 FROM (SELECT cs_sold_date_sk, cs_item_sk, cs_bill_cdemo_sk, cs_bill_customer_sk, cs_quantity, cs_list_price, cs_coupon_amt, cs_sales_price, cs_net_profit FROM catalog_sales WHERE cs_wholesale_cost BETWEEN 5 AND 10) AS cs JOIN date_dim ON cs.cs_sold_date_sk = date_dim.d_date_sk JOIN item ON cs.cs_item_sk = item.i_item_sk JOIN customer_demographics ON cs.cs_bill_cdemo_sk = customer_demographics.cd_demo_sk JOIN customer ON cs.cs_bill_customer_sk = customer.c_customer_sk JOIN customer_address ON customer.c_current_addr_sk = customer_address.ca_address_sk WHERE date_dim.d_year = 1999 AND item.i_category = 'Music' AND customer_demographics.cd_gender = 'F' AND customer_demographics.cd_education_status = '4 yr Degree' AND customer.c_birth_month = 12 AND customer_address.ca_state IN ('AR', 'IN', 'VA') GROUP BY ROLLUP (i_item_id, ca_country, ca_state, ca_county) ORDER BY ca_country, ca_state, ca_county, i_item_id LIMIT 100